import Footer from "components/footer";
import Header from "components/Home/header"; // Asegúrate de que la ruta sea correcta
import Navbar from "components/navigation/navbar";
import Layout from "hocs/layouts/layout";

function Home() {
    return (
        <Layout>
            <Navbar />
            <div className="pt-24">
                <Header />
            </div>
            <Footer />
        </Layout>
    );
}

export default Home;
